import axios from "axios";

export async function login(userName, password) {
  const url = "http://localhost:8080";

  console.log("Sending request");
  const response = await axios.get(url, {
    params: {
      user: userName,
      pass: password
    }
  });
  if (response.data === "correct") return true;
  else return false;
}
